	return (
		<div className="App">
			<header className="App-header">
				<div className="logo-container">
					<img src={logo} className="App-logo" alt="logo" />
					<h1 className="App-title">Mi Aplicación</h1>
				</div>
				<nav className="App-menu">
					<FileUploader />
					<QuestionShuffler />
				</nav>
			</header>
			{/* Resto del contenido de la aplicación */}
		</div>
	);
}

export default App;
